import React from 'react';
import PannellumReact from './PannellumReact.js'
import MapComp from './Map.js'
import UIButton from "./UIButton"; 


class app extends React.Component 
{
    constructor(props)
    {
        super(props);
        this.state = { currentComponent: 'Map' };
    }

    App() 
    {
        function switchComponent(currentComponent)
        {
           this.setState({currentComponent: currentComponent});
           console.log(this.state);
        };

      return (
        <div className="App">
            {
                this.state.currentComponent === 'Map' &&
                <MapComp toggleMap={switchComponent}/> 
            }
            {
                this.state.currentComponent === 'PanoViewer' &&
                <PannellumReact toggleMap={switchComponent}/>
            }
        </div>
      );
    }
}

export default App;
